<template>
    <div v-if="icon_b64 || approved_icon.length > 0"
         class="wrapper-default-block d-flex align-items-center justify-content-center flex-grow-1 magnif-glass"
         data-toggle="modal"
         data-target="#downloadModal"
         @click="handleDropdownClick"
    >
        <span class="data-name">Icon & Favicon</span>
        <div class="three-elements default-block">
            <div v-if="icon_b64" class="d-flex align-items-center justify-content-center logo-block-v3 main-white">
                <img :src="icon_b64"/>
            </div>

            <div
                v-for="(icon, index) in approved_icon.slice(0, 2)"
                :key="index"
                :style="getIconStyle(icon)"
                class="d-flex align-items-center justify-content-center logo-block-v3 main-white"
            >
                <img :src="icon.icon_b64"/>
            </div>
        </div>
    </div>
</template>
<script>
    import {EventBus} from '../../../event-bus';

    export default {
        props: {
            icon_b64: {
                type: String,
                default: ''
            },
            approved_icon: {
                type: Array,
                default: () => []
            },
        },
        data() {
            return {};
        },
        methods: {

            getIconStyle(icon) {
                return `background-color: ${icon.background === 'transparent' ? '#fff' : icon.background}; color: ${icon.background === 'transparent' ? 'light' : 'dark'}`;
            },
            setFavIcons() {
                let tempIcons = [];

                tempIcons.push({
                    colorBg: 'transparent',
                    colorLogo: 'light',
                    logo: this.icon_b64,
                    customCss: `background-image: url(data:image/png;base64,);
                                background-size: auto 217px;
                                background-color: transparent !important;`,
                });

                tempIcons.push({
                    colorBg: '#fff',
                    colorLogo: 'light',
                    logo: this.icon_b64,
                });

                if (this.approved_icon) {
                    this.approved_icon.map(function (icon, index) {
                        if (index == 0) {
                            tempIcons.push({
                                colorBg: 'transparent',
                                colorLogo: 'light',
                                logo: icon.icon_b64,
                                customCss: `background-image: url(data:image/png;base64,);
                                            background-size: auto 217px;
                                            background-color: transparent !important;`,
                            });
                        }
                        tempIcons.push({
                            colorBg: (icon.background == 'transparent') ? '#fff' : icon.background,
                            colorLogo: (icon.background == 'transparent') ? 'light' : 'dark',
                            logo: icon.icon_b64,
                            border_radius: icon.border_radius || '0%',
                            customCss: icon.border_radius ? `border-radius: ${icon.border_radius};` : ''
                        });
                    });
                }

                return tempIcons;
            },
            handleDropdownClick() {
                EventBus.$emit('show-modal', {
                    items: this.setFavIcons(),
                    title: 'Icon & Favicon'
                });
            },
        }
    };
</script>
